import {
    Div_BackGroundImg,
    Div_Body,
    Div_DirItemContainer
} from './directory-item.styles.jsx'

const DirectoryItem = ({category}) => {
    const { title, imageUrl } = category
    return (
        <Div_DirItemContainer>
            <Div_BackGroundImg imageUrl={imageUrl} />
            <Div_Body>
                <h2>{title}</h2>
                <p>Shop Now</p>
            </Div_Body>
        </Div_DirItemContainer>
    )
}

export default DirectoryItem;
